import React, {useState} from 'react';
import TopNav from '../components/Navbar/TopNav';
import logo from "../images/MariaFloristaLogo.jpg";
import ShowPlants from '../components/ShowPlants';


const SellerProfile = () =>{

    const [comments, setComments] = useState([]);
    const [newComment, setNewComment] = useState('');

    function handleSubmit(e) {
      e.preventDefault();
      if (newComment.trim() === '') return;
      setComments([...comments, newComment.trim()]);
      setNewComment('');
    }

    const [rating, setRating] = useState(0);

    const handleRating = (value) => {
        setRating(value);
    }

    return(
        <div className='full_div'>
            <TopNav />
            <center>
                <div ><h2>Perfil de Maria Florista</h2></div>
            </center>
            <center>
            <div style={{ border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '80%' }}>
                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '100%', margin: '0 auto' }}>

                    <div><img src={logo} alt="Maria Florista" style={{ width: 'auto', height: '60%', objectFit: 'cover' }} /></div>
                    <div style={{ border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '60%' }}>   
                        <div><h3>Name : Maria Florista</h3></div>
                        <div><h3>Location : Aveiro, Portugal</h3></div>
                        <div><h3>About : We sell the freshest plants at the freshest prices!</h3></div>
                        <div>
                            <h3>Rating : </h3>
                            <input type="radio" id="star-5" name="rating" value="5" onClick={() => handleRating(5)} />
                            <label htmlFor="star-5" className={rating >= 5 ? "active" : ""}></label>
                            <input type="radio" id="star-4" name="rating" value="4" onClick={() => handleRating(4)} />
                            <label htmlFor="star-4" className={rating >= 4 ? "active" : ""}></label>
                            <input type="radio" id="star-3" name="rating" value="3" onClick={() => handleRating(3)} />
                            <label htmlFor="star-3" className={rating >= 3 ? "active" : ""}></label>
                            <input type="radio" id="star-2" name="rating" value="2" onClick={() => handleRating(2)} />
                            <label htmlFor="star-2" className={rating >= 2 ? "active" : ""}></label>
                            <input type="radio" id="star-1" name="rating" value="1" onClick={() => handleRating(1)} />
                            <label htmlFor="star-1" className={rating >= 1 ? "active" : ""}></label>
                        </div>
                    </div>
                </div>
                <div style={{marginTop:'20px'}}>

                    <ShowPlants></ShowPlants>
                </div>
                <div style={{width:'100%'}}>
                  <h2>Comments</h2>
                    <form onSubmit={handleSubmit}>
                        <input
                            type="text"
                            placeholder="Add a comment"
                            value={newComment}
                            onChange={(e) => setNewComment(e.target.value)}
                            />
                        <button type="submit">Submit</button>
                    </form>
                    <ul>
                    {comments.map((comment, index) => (
                      <li key={index}>{comment}</li>
                    ))}
                  </ul>
                </div>
            </div>
            </center>
        </div>
    );
}

export default SellerProfile;
